css:
atom-text-editor {
  background-color: #272822;
  color: white;
}
atom-text-editor .wrap-guide {
  background-color: #5d5f51;
}
atom-text-editor .indent-guide {
  box-shadow: inset 1px 0 #424439;
}
atom-text-editor .invisible-character {
  color: #4f5145;
}
atom-text-editor .gutter {
  background-color: #272822;
  color: #868686;
}
atom-text-editor .gutter .line-number.cursor-line {
  background-color: #39382e;
  color: #868686;
}
atom-text-editor .gutter .line-number.cursor-line-no-selection {
  color: #868686;
}
atom-text-editor .fold-marker:after,
atom-text-editor .gutter .line-number.folded,
atom-text-editor .gutter .line-number:after {
  color: #CCC;
}
atom-text-editor .invisible {
  color: white;
}
atom-text-editor .cursor {
  color: white;
}
atom-text-editor .selection .region {
  background-color: #424242;
}
atom-text-editor .search-results .syntax--marker .region {
  background-color: transparent;
  border: 1px solid #5d5f51;
}
atom-text-editor .search-results .syntax--marker.current-result .region {
  border: 1px solid white;
}
.syntax--comment {
  color: #75715E;
}
.syntax--string {
  color: #E6DB74;
}
.syntax--source {
  color: white;
}
.syntax--source.syntax--sql.syntax--embedded.syntax--php {
  color: #E6DB74;
}
.syntax--constant.syntax--character,
.syntax--constant.syntax--language,
.syntax--constant.syntax--numeric,
.syntax--constant.syntax--other {
  color: #AE81FF;
}
.syntax--keyword {
  color: #F92672;
}
.syntax--storage {
  color: #F92672;
}
.syntax--storage.syntax--type {
  font-style: italic;
  color: #66D9EF;
}
atom-text-editor[mini] .scroll-view {
  padding-left: 1px;
}
atom-text-editor .search-results .syntax--marker .region {
  background-color: transparent;
  border: 1px solid #5d5f51;
}
atom-text-editor .search-results .syntax--marker.current-result .region {
  border: 1px solid white;
}
atom-text-editor .syntax--gfm .syntax--markup.syntax--heading {
  color: #A6E22E;
  font-weight: bold;
}
atom-text-editor .syntax--gfm .syntax--markup.syntax--underline {
  color: #E6DB74;
  text-decoration: underline;
}
atom-text-editor .syntax--gfm .syntax--bold {
  font-weight: bold;
}
atom-text-editor .syntax--gfm .syntax--italic {
  font-style: italic;
}
atom-text-editor .syntax--gfm .syntax--raw {
  color: #66D9EF;
}
atom-text-editor .syntax--gfm .syntax--variable.syntax--list {
  color: #F92672;
  font-weight: bold;
}
atom-text-editor .syntax--gfm .syntax--link {
  color: #CCC;
}
atom-text-editor .syntax--gfm .syntax--link .syntax--entity {
  color: #AE81FF;
}
.syntax--entity.syntax--name.syntax--class {
  text-decoration: none;
  color: #A6E22E;
}
.syntax--entity.syntax--name.syntax--function {
  color: #A6E22E;
}
.syntax--method-call .syntax--entity.syntax--name.syntax--function {
  color: #66D9EF;
}
.syntax--entity.syntax--name.syntax--instance {
  color: #66D9EF;
}
.syntax--entity.syntax--name.syntax--tag {
  color: #F92672;
}
.syntax--entity.syntax--other.syntax--attribute-name {
  color: #A6E22E;
}
.syntax--entity.syntax--other.syntax--inherited-class {
  font-style: italic;
  text-decoration: none;
  color: #A6E22E;
}
.syntax--entity.syntax--other.syntax--class.syntax--jade {
  color: #AE81FF;
}
.syntax--punctuation.syntax--definition.syntax--parameters,
.syntax--punctuation.syntax--section.syntax--embedded,
.syntax--punctuation.syntax--section.syntax--scope,
.syntax--punctuation.syntax--separator,
.syntax--punctuation.syntax--terminator.syntax--expression {
  color: white;
}
.syntax--invalid {
  color: #F8F8F0;
  background-color: #F92672;
}
.syntax--invalid.syntax--deprecated {
  background-color: #AE81FF;
}
.syntax--invalid.syntax--illegal {
  background-color: #cc6666;
  color: #272822;
}
.syntax--support.syntax--constant,
.syntax--support.syntax--function {
  color: #66D9EF;
}
.syntax--support.syntax--class,
.syntax--support.syntax--type {
  font-style: italic;
  color: #66D9EF;
}
.syntax--variable {
  color: white;
}
.syntax--variable.syntax--language.syntax--python,
.syntax--variable.syntax--language.syntax--js {
  color: #F92672;
  font-style: italic;
}
.syntax--meta.syntax--tag {
  color: white;
}
.syntax--meta.syntax--delimiter.syntax--period {
  color: #F92672;
}
.syntax--meta.syntax--function-call:not(.syntax--js) {
  color: #66D9EF;
}
.syntax--meta.syntax--function .syntax--variable {
  font-style: italic;
  color: #FD971F;
}
.leading-whitespace,
.trailing-whitespace {
  display: inline-block;
}
.syntax--php .syntax--punctuation.syntax--section.syntax--embedded {
  font-weight: bold;
  font-style: italic;
}
